import React from 'react';
import { Doughnut } from 'react-chartjs-2';

const SpendDonut = ({cost}) => {
  const data = {
    labels: ['Food', 'Home', 'Fun', 'Travel', 'Health', 'Learn', 'Shop', 'Lend', 'Others'],
    datasets: [
      {
        label: '# of Votes',
        data: [cost['food'], cost['home'], cost['fun'], cost['travel'], cost['health'], cost['learn'], cost['shop'], cost['lend'], cost['others']],
        backgroundColor: [
          'rgba(255, 99, 132, 0.2)',
          'rgba(54, 162, 235, 0.2)',
          'rgba(255, 206, 86, 0.2)',
          'rgba(75, 192, 192, 0.2)',
          'rgba(153, 102, 255, 0.2)',
          'rgba(255, 159, 64, 0.2)',
          'rgba(255, 99, 132, 0.2)',
          'rgba(54, 162, 235, 0.2)',
          'rgba(255, 206, 86, 0.2)'
        ],
        borderColor: [
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
          'rgba(153, 102, 255, 1)',
          'rgba(255, 159, 64, 1)',
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)'
        ],
        borderWidth: 1
      }
    ]
  };

  return (
    <div>
      <Doughnut data={data} />
    </div>
  );
};

export default SpendDonut;
